INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('65dd5d47-3884-428b-91ab-5606ff56a7aa', 'a8ad9443-6e16-42dc-bd5a-a1c2b6c1811c', 'duFtdxGwvf.jpg', '外観', 'デッキ材を使った２階テラスの手摺の高さを高くして周囲から見えづらくしました。', 'f', '2017-10-22 08:05:34.641023', '2017-10-22 08:05:34.641023');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('f618d3b0-4dae-4fe1-9c92-a47f9d01479d', 'a8ad9443-6e16-42dc-bd5a-a1c2b6c1811c', 'KHqdJYq06k.jpg', '2F_LDK', '中央部分の白い壁に囲まれた部分は屋上にある窓から自然光を１階に落す為のライトウェル（光井戸）です。２階はこの白い壁で空間をおおらかに分けています。', 'f', '2017-10-22 08:05:35.549827', '2017-10-22 08:05:35.549827');
