INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('4f6d366c-489b-4380-bca0-fb470e7b9606', 'c2913542-6f4b-4806-a4e0-9bce08b3a5ec', 'VjgJ0DG5tA.jpg', 'リビングダイニング2', NULL, 'f', '2017-10-22 08:12:51.088975', '2017-10-22 08:12:51.088975');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('f06d3172-1b47-4bf6-9c3e-a51fca6f542f', 'c2913542-6f4b-4806-a4e0-9bce08b3a5ec', 'N4KJ2xnQHD.jpg', 'リビングルーム', 'コンクリートのラフで力強い素材感を活かしたリビング空間です。床フローリングはオーストリア製最高級品のMafiの幅広・ロングフローリングを施主支給で現地に配達して貰っています。', 'f', '2017-10-22 08:12:51.718171', '2017-10-22 08:12:51.718171');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('ef4f3b0f-3a75-4951-9a46-85ace3cad255', 'c2913542-6f4b-4806-a4e0-9bce08b3a5ec', 'VI8yG7CZ6V.jpg', 'キッチン', 'アイランドカウンター中央を貫通する丸柱は、既存の共用竪配管です。解体時に位置を確認してから、キッチンを設計し、二つのキャビネットとカウンターを作って、現地で配管を挟む形で合体させています', 'f', '2017-10-22 08:12:52.376589', '2017-10-22 08:12:52.376589');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('ac16c6a4-6bbe-4889-a60a-4ca8a4f0cd0c', 'c2913542-6f4b-4806-a4e0-9bce08b3a5ec', '5TohFJU3DB.jpg', 'バス', '素っ気ないほどシンプルなモルタルで仕上げた浴室です。サイズ的な問題と他の部屋とのコストの掛け方の問題で、モルタル仕上げとしましたが、テンパーガラスの扉、カルデヴァイの浴槽、グローエの水栓類を使うことで、存在感のある浴室になりました', 'f', '2017-10-22 08:12:52.974547', '2017-10-22 08:12:52.974547');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('b880eb04-0aab-48fd-9627-811e653820c6', 'c2913542-6f4b-4806-a4e0-9bce08b3a5ec', 'XPWYMDN9fm.jpg', '洗面', NULL, 'f', '2017-10-22 08:12:53.882172', '2017-10-22 08:12:53.882172');
