INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('b023e12b-ef6a-41f1-bf16-5d812f684cfc', 'b4c4292f-9434-4f4d-92bc-fe85b624b398', 'FH8oMKiu49.jpg', '二世帯の共用エントランス', '二世帯共用のエントランス．法的な諸条件をクリアしつつ，限られた旗竿敷地を最大限利用するため，屋外としていますが，背の高い黒壁で囲い，背の高いゲートのような開口をくぐり抜けると白い壁とすることで，同じ家に入る感覚を演出しています．', 'f', '2017-10-22 08:18:24.304453', '2017-10-22 08:18:24.304453');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('8a342ab0-723c-4444-afdb-d6916eb54632', 'b4c4292f-9434-4f4d-92bc-fe85b624b398', 'YGOeLQ5mTB.jpg', '旗竿側から見た外観', '旗竿敷地の二世帯共用エントランス．二世帯共用を象徴する大きな開口と，赤錆の鉄扉が印象的なファサードです．', 'f', '2017-10-22 08:18:25.58197', '2017-10-22 08:18:25.58197');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('1baefe6a-d5b9-4747-9879-16f58a00f79f', 'b4c4292f-9434-4f4d-92bc-fe85b624b398', '3Hg41QA3wV.jpg', '明るい一階のリビング', '親世帯が暮らすリビング．旗竿敷地の一階という条件の悪い中，南北にセミプライベートなテラスを取ることで，プライバシーを確保しつつ最大限の明るさと通風を確保しました．', 'f', '2017-10-22 08:18:26.225616', '2017-10-22 08:18:26.225616');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('73dae2e3-c1b5-483a-beaf-7c0ac5465696', 'b4c4292f-9434-4f4d-92bc-fe85b624b398', 'ZbnF4VAdq7.jpg', 'スキマの書斎', 'リビングからウォークインクローゼットに入る通路に設けられた書斎コーナー', 'f', '2017-10-22 08:18:26.84395', '2017-10-22 08:18:26.84395');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('ab8324ab-5e68-48cf-861a-0253e0e25f23', 'b4c4292f-9434-4f4d-92bc-fe85b624b398', 'XFFSyV9vx7.jpg', '親子で光と風を共有する開口1', '南側のテラスの外側に建てられた壁には上下階の中央に1階分の高さで開口が開いています．旗竿敷地の中で光と風を最大限取り込みつつ，プライバシーを保つ役割を持っています．', 'f', '2017-10-22 08:18:27.515637', '2017-10-22 08:18:27.515637');
