INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('ad854154-fa54-4ea3-bb99-56757922f00c', '3901386c-a060-46f6-9553-57a62f9204ed', 'o4TWQeIpi6.jpg', '可動本棚の家', '１０坪の空間最大限有効利用するために可動本棚や可動間仕切り、コアガリなどを使って、ワンルームから２LDKまで空間の間取りを変更出来る空間としました。', 'f', '2017-10-22 08:20:49.681434', '2017-10-22 08:20:49.681434');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('439cee5b-a89a-4828-8d03-63f08da85e2f', '3901386c-a060-46f6-9553-57a62f9204ed', 'kbRF2wyjQG.jpg', 'コアガリ', 'リビングに設けたコアガリ。大勢の来客時にはベンチとしても利用出来ます。コアガリの下部は大容量の全面床下収納となっています。', 'f', '2017-10-22 08:20:50.360175', '2017-10-22 08:20:50.360175');
