INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('b2a210dd-4451-44f5-bf09-586f786d6c50', '3901386c-a060-46f6-9553-57a62f9204ed', 'dcxLlMz4od.jpg', '可動本棚', '可動本棚はリビング側にブックディスプレイ、寝室側を本棚としています。潜戸は可動本棚をリビング側に引出し、寝室を作った時のアクセスに使用します。ワンルームとして大きく使いたい時は可動本棚を壁側に納めます。', 'f', '2017-10-22 08:20:51.767614', '2017-10-22 08:20:51.767614');
INSERT INTO "photos"("id", "house_id", "image", "title", "description", "featured_photo", "created_at", "updated_at") VALUES ('946cbbf6-c6a5-43e1-9821-36dcc601fed7', '3901386c-a060-46f6-9553-57a62f9204ed', '66lQFThj75.jpg', '寝室', '可動本棚を全面に引出すことで、寝室を作ることが出来ます。寝室へは潜戸を使って入ることが出来ます。必要に応じて部屋をつくれるので空間を有効に利用することが出来ます。', 'f', '2017-10-22 08:20:53.220497', '2017-10-22 08:20:53.220497');
